import React, { Component } from 'react';
import './Navbar.scss';
import $ from 'jquery';
import './grc-logo.png';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {
  componentDidMount() {
    $('.hamBox').on('click', function() {
      var open = true;
      $('.menu').slideToggle();
      $('.bagIcon').toggleClass('slideOut');
    });
  }
  render() {
    return (
      <div>
        <nav>
          <span className="hamBox">
            <span className="ham" />
          </span>
          <span className="logoBox">
          <img src="./grc-logo.png" alt="Grc Logo"></img>
          </span>

        </nav>
        <div className="menuCase">
          <ul className="menu">
            <li>Mac</li>
            <li>iPad</li>
            <li>iPhone</li>
            <li>Watch</li>
            <li>TV</li>
            <li>Music</li>
            <li>Support</li>
            <li>Search apple.com</li>
          </ul>
        </div>
      </div>
    )
  }
}
